import React from "react";
import ReactDOM from "react-dom";
function Card(){
    return(
        <>
        <div className="cards">
          <div className="card">
            <img src="https://wallpapercave.com/wp/wp3850252.jpg" alt="MyPic" className="card_img" />
            <div className="card_info">
              <span className="card-category">A Marvel Original Movie</span>
              <h3 className="card_title">Avengers Endgame</h3>
              <a href="https://www.hotstar.com/in/movies/avengers-endgame/1260013556" target="_blank">
                <button> Watch Now </button>
              </a>
            </div>
          </div>
        </div>
      </>
    )
}
ReactDOM.render(
  <Card/>,
  document.getElementById("root")
);
